import React, { Component } from 'react'
import './index.css'
export default class Item extends Component {
  state={mouse:false}
  render() {
    return (
        <li onMouseEnter={this.handleMouse}>
            <label>
                <input type="checkbox" defaultChecked={this.props.done}/>
                <span>{this.props.name}</span>
            </label>
        </li>
    )
  }
}
